static bool format_decimal(char *buf, size_t cap, unsigned value, size_t *out_len)
{
    if (!buf || cap == 0)
    {
        return false;
    }
    char tmp[16];
    size_t count = 0;
    do
    {
        if (count >= sizeof(tmp))
        {
            return false;
        }
        tmp[count++] = (char)('0' + (value % 10));
        value /= 10;
    } while (value != 0);

    if (count + 1 > cap)
    {
        return false;
    }
    for (size_t i = 0; i < count; ++i)
    {
        buf[i] = tmp[count - 1 - i];
    }
    buf[count] = '\0';
    if (out_len)
    {
        *out_len = count;
    }
    return true;
}

static bool parse_decimal_size(const char *text, size_t *out)
{
    size_t value = 0;
    if (!text || *text == '\0')
    {
        return false;
    }
    const char *p = text;
    while (*p)
    {
        if (*p < '0' || *p > '9')
        {
            return false;
        }
        size_t digit = (size_t)(*p - '0');
        if (value > (SIZE_MAX - digit) / 10)
        {
            return false;
        }
        value = value * 10 + digit;
        ++p;
    }
    *out = value;
